#Find the length of longest substring without repeating characters

class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        if len(s)<1:
            return 0
        maxlength = 1
        for i in xrange(len(s)):
            l1 = self.getMaxLength(s,i,i+1)
            if maxlength < l1:
                maxlength = l1
        return maxlength

    def getMaxLength(self, s,start, end):
        length = 0
        sub =''
        while start >= 0 : #check for the left side
            if s[start] in set(sub):
                break
            else:
                sub += s[start]
                length +=1

            start -=1
        while end<len(s):    #check for the right side
            if s[end] in set(sub):
                break
            else:
                sub += s[end]
                length +=1
            end +=1
        return length
